  DAVIES, George Neville and TODD, Valerie Ethel (cont...)
  Queensland Museum as Curator in Arachnology (1972), and later, Senior Curator. After her retirement she
  was made an Honorary Associate. In recognition of her arachnological research she was awarded the
  Queensland Museum Medal in 1988 and was appointed a Vice-President of the Centre Internationale
  Documentaire Arachnologique in 1989. She was Secretary of the XIIth International Congress on
  Arachnology held in Brisbane in July 1992. Valerie's other interests include gardening, reading,
  bridge, golf and croquet.
  01> DAVIES, Christopher Todd m on 03.10.1981 to FLEET, Susan
  b 24.09.1950
  b 03.05.1955
  Address: 3 Wingate Road, Hale, Altrincham, Cheshire WA15 OL2, England.
  Christopher was educated at Maori Hill School, Dunedin; Church of England
  Grammar School, Brisbane and the University of Queensland. He also spent a
  short period in postgraduate study at Oxford University. At CEGS he
  developed an interest in rowing and scouting and became a Queen's Scout.
  At the University of Queensland he was an active water skiier and served
  as President of the University Club. He graduated Bachelor of Engineering with First Class Honours
  in Chemical Engineering and soon after left for England to further his experience. He is a Member
  of the Institution of Chemical Engineers and a Chartered Engineer. He was a chemical engineer with
  the British Gypsum Company in Nottingham before his appointment as Information Technology manager
  with Betz Limited, Winsford, Cheshire, Christopher is co-holder of a patent for a submerged
  combustion calcination process developed during his time with British Gypsum and now used
  world-wide to produce plaster from gypsum. His other interests include water skiing, squash and
  photography.
  Susan trained as a nurse (RMN, SRN) and after her marriage she developed an interest in psychology.
  She graduated with a BSc (1st Class Hons) from Manchester Polytechnic and later, for her research
  on autism, graduated PhD from the University of Manchester.
  01> DAVIES, William Todd
  b 21.11.1984
  William attended Pownall Hall School prep school in Wilmslow, Cheshire and is now at Altrichan
  Grammar School.
  02> DAVIES, Elizabeth
  b 09.08.1991
  02> DAVIES, John William
  b 12.08.1952
  Address: 3 Kapunda Street, Toowong 4066, QInd, Australia.
  John was educated at Maori Hill School, Dunedin; Church of England Grammar School,
  Brisbane; University of Queensland; Hochschule fur Musik und Theatre, Hannover,
  Germany; and Flinders University, Adelaide, South Australia. At CEGS he was a
  prefect, Dux of the School and was encouraged to develop an interest in music. He
  graduated from the University of Queensland with First Class Honours in Music in
  1975 and was awarded a University Medal and the Foundation Scholarship for study overseas. After
  two years study in Hannover, John was awarded the Abschlussprufung in Piano in 1977. He then
  returned to Australia and studied Medicine at Flinders University Medical School, graduating BM, BS
  in 1983. After taking an internship at the Royal Adelaide Hospital he undertook further specialist
  study and is now practising as a Psychiatrist in Brisbane. His interests include music, tennis,
  golf and chess.
